class Node {
    int item;
    Node left, right;

    public Node(int key) {
        item = key;
        left = right = null;
    }
}

class CountingLeaves {
    // root of Tree
    Node root;

    CountingLeaves() {
        root = null;
    }

    // method to count leaf nodes
    public static int countLeaf(Node node) {
        if (node == null) {
            return 0;
        }
        // if left and right of the node is null
        // it is leaf node
        if (node.left == null && node.right == null) {
            return 1;
        } else {
            return countLeaf(node.left) + countLeaf(node.right);
        }
    }

    public static void main(String[] args) {
        // create an object of Tree
        CountingLeaves tree = new CountingLeaves();
        // create nodes of tree
        tree.root = new Node('p'); // root
        tree.root.left = new Node('g'); // left
        tree.root.right = new Node('w'); // right
        tree.root.left.left = new Node('c'); // left child of left node
        tree.root.left.right = new Node('k'); // right child of left node
        tree.root.right.left = new Node('s'); // left child of right node
        tree.root.right.right = new Node('y'); // right child of right node
        tree.root.left.left.left = new Node('a'); // left child of left child of left node
        tree.root.left.left.right = new Node('e'); // right child of left child of left node
        tree.root.left.right.left = new Node('i'); // left child of right child of left node
        tree.root.left.right.right = new Node('m'); // right child of right child of left node
        tree.root.right.left.left = new Node('q'); // left child of left child of right node
        tree.root.right.left.right = new Node('u'); // right child of left child of right node
        tree.root.right.right.left = new Node('x'); // left child of right child of right node
        tree.root.right.right.right = new Node('z'); // right child of right child of right node

        // call method to count leaf nodes
        int leafNodes = countLeaf(tree.root);
        System.out.println("Total Leaf Nodes = " + leafNodes);
    }
}

import java.util.Scanner;

public class QueueCipher {
    public static String CaesarCipher(String cleartext, int key) {
        String ciphertext = ""; // Initialize ciphertext

        for (int i = 0; i < cleartext.length(); i++) { // Loop through cleartext
            char c = cleartext.charAt(i); // Get the current character
            if (Character.isLetter(c)) { // Check if the character is a letter
                if (Character.isUpperCase(c)) { // Check if the character is uppercase
                    ciphertext += (char) ('A' + (c - 'A' + key) % 26); // Encrypt uppercase character
                } else {
                    ciphertext += (char) ('a' + (c - 'a' + key) % 26); // Encrypt lowercase character
                }
            } else {
                ciphertext += c; // Leave non-letter characters unchanged
            }
        }
        return ciphertext;
    }

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in); // Initialize scanner

        System.out.print("Enter the cleartext: ");
        String cleartext = scanner.nextLine(); // Read cleartext

        System.out.print("Enter the increment value k: ");
        int key = scanner.nextInt(); // Read increment value

        scanner.close(); // Close scanner

        String ciphertext = CaesarCipher(cleartext, key);
        System.out.println("Ciphertext: " + ciphertext); // Print ciphertext
    }
}

