on *:SOCKOPEN:mysocket: {
  if ($sockerr) return
  sockwrite -t $sockname $sock($sockname).mark
}

on *:SOCKREAD:mysocket: {
  if ($sockerr) return
  var %read
  sockread %read
  if ($sockbr == 0) return
  ; A line is guaranteed to be in %read at this point, but it can be an empty line.
  ; echo -ag > %read
}

on *:SOCKCLOSE:mysocket: {
  if ($sock($sockname).rq) {
    var %a
    sockread -f %a
    ; echo -ag closing debug: %a
    ; echo -ag > $regsubex(%a,/.*":"(.*)"}/,\1)
    
    var %filteredData = $regsubex(%a,/.*":"(.*)"}/,\1)

    ; echo -a %filteredData
    mymsg #ScriptTesting %filteredData
  }
}

alias mymsg {
  ; /mymsg <#channel> <text>

  if ($0 < 2) { return } 

  var %a = $2-
  var %t = $numtok(%a,32)
  var %i = 1

  while (%i <= %t) {
    var %w = $gettok(%a,%i,32)

    if ($len(%o) > 255) { msg $1 %o | unset %o }

    var %o = $addtok(%o,%w,32)

    inc %i
  }
  
  if (%o) { msg $1 %o }
}

class Node {
  constructor(i_Val, i_Next = null) {
    this.val = i_Val;
    this.next = i_Next;
  }
}

const findPathFromSourceToDestination = (src, dst) => {
  const arr = [];
  //   const arr = src.split("/").map((curFolder) => new Node(curFolder));
  const headSrc = src
    .split("/")
    .reduceRight((next, val) => new Node(val, next), null);

  const headDst = dst
    .split("/")
    .reduceRight((next, val) => new Node(val, next), null);

  let travelerSrc = headSrc;
  let travelerDst = headDst;

  while (travelerSrc && travelerDst && travelerSrc.val === travelerDst.val) {
    travelerSrc = travelerSrc.next;
    travelerDst = travelerDst.next;
  }

  // now we are at the point of one after the intersection
  // src = a->b->d->g->null
  //          |
  //          v
  //    dst = c->e->f->null
  // so we need to add to the result path '..' x times
  // when x = nodes left from travelerSrc to null - in our case - 2
  while (travelerSrc) {
    arr.push("..");
    travelerSrc = travelerSrc.next;
  }

  // now we are back to a->b, we need to add all nodes from travelerDst
  while (travelerDst) {
    arr.push(travelerDst.val);
    travelerDst = travelerDst.next;
  }

  return arr.join("/");
};

const src = "a/b/d/g";
const dst = "a/b/c/e/f";

console.log(findPathFromSourceToDestination(src, dst));

